func TestMCSABI(t *testing.T) {
	t.Log(MCSAbi.Constructor)
	t.Log("events")
	for n, e := range MCSAbi.Events {
		t.Log(n, "=>", e)
	}
	t.Log("methods")
	for n, e := range MCSAbi.Methods {
		t.Log(n, "=>", e)
	}
	t.Log("errors")
	for n, e := range MCSAbi.Errors {
		t.Log(n, "=>", e)
	}
	t.Log(MCSAbi.Fallback)
	t.Log(MCSAbi.Receive)
}

